import React, { Component } from 'react';

class Experience extends Component {
    render() {
        return (
            <div>
                <div className = "card">
                    <div className = "card-content">
                        <h6><strong>Kinh Nghiệm</strong></h6>
                                <p>
                                    <b>Từ tháng 1/2018 - tháng 1/2019</b> <p>Thực tập web tại công ty ABC.</p>
                                </p>



                    </div>
                </div>
            </div>
        );
    }
}

export default Experience;
